\parbox{5cm}{
\textbf{Scene rendering}:\\[0.1cm]
\setlength{\leftmargini}{1em} 
\begin{itemize}
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Let OpenGL generate the illuminated scene
\item Retrieve arbitrary 2D views / perspectives
\end{itemize}}

\parbox{5cm}{
\textbf{Scene modeling}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Position object model on the seafloor
\item Position camera
\end{itemize}}

\parbox{5cm}{
\textbf{Compute illumination}:\\[0.1cm]
\setlength{\leftmargini}{1em} 
\begin{itemize}
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Refraction/reflection capable raytracer, or
\item two-way Huygens(?)
\end{itemize}}

\parbox{5cm}{
\textbf{Scene modeling}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Position object model on the seafloor
\item Position camera
\item Map sound parameters to equivalent light parameters
\item Simulate the array as lightsources
\end{itemize}}
